INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(1, 3, 1519302727, 'New Beginnings', 'new-beginnings', 1, 1490272200, 1490272200, 'Gentrify synth raw denim', '<p>Use the Themes Custome Frontend Modules to either display news teasers without images or only the news teasers with images.</p>\n<p>Cold-pressed fashion axe neutra, pickled tousled yr chia. Sartorial stumptown YOLO, +1 thundercats small batch freegan craft beer lo-fi knausgaard ugh normcore distillery. Bicycle rights tousled franzen tumblr. You probably haven''t heard of them ethical retro art party. PBR[&]B selfies cred austin man braid intelligentsia biodiesel.</p>', '1', '', 0x523ac2fb17cc11e8a370b1a115865f49, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:1:"2";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '1', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '');
