INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `overwriteMeta`, `singleSRC`, `alt`, `imageTitle`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(3, 3, 1519309767, 'Frontpage News', 'frontpage-news', 1, 1490013300, 1490013300, 'Subheadline', '<p>Blind Text: Thundercats slow-carb poutine, normcore vinyl salvia bicycle rights intelligentsia hashtag fingerstache yuccie ugh. Pug helvetica stumptown readymade, fixie kogi pabst. Wayfarers chicharrones pinterest, vice polaroid retro man bun meditation 8-bit tousled kinfolk. Poutine cornhole fixie, VHS mumblecore selvage actually swag roof party.[nbsp]Pop-up heirloom bushwick master cleanse gentrify synth raw denim.</p>', '', '', NULL, '', '', '', '', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '');

